def kmp(needle):
    n=len(needle)
    needle1=needle
    s=[0]
    i=1
    i1=0
    while(i<n): #ABCDABD
        if needle[i]!=needle1[i1] and i1==0:
            s.append(0)
            i=i+1
           # continue #不在执行后续语句
        elif  needle[i]==needle1[i1]:
            s.append(s[len(s)-1]+1)
            i+=1
            i1+=1
        elif needle[i]!=needle1[i1] and i1!=0:
            i1=i1-(i1-s[i1-1])
    print(s)
    return s



